import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract visible user profile data (if available)
    const userData = {};

    // Attempt to extract email or phone number
    const emailOrPhone = await page.$eval('#email', el => el.value);
    if (emailOrPhone) userData.emailOrPhone = emailOrPhone;

    // Attempt to extract password (Note: this field is usually not accessible for security reasons)
    const password = await page.$eval('#password', el => el.value);
    if (password) userData.password = password;

    // Check for other visible user profile data (like name)
    const firstName = await page.$eval('input[placeholder="First name"]', el => el.value);
    const lastName = await page.$eval('input[placeholder="Last name"]', el => el.value);
    if (firstName) userData.firstName = firstName;
    if (lastName) userData.lastName = lastName;

    // Log the extracted user data
    console.log('Extracted User Data:', userData);

    return {
      success: true,
      action: "Extracted visible user profile data from the page",
      extractedData: userData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
